import React from 'react';
import { Row, Col } from 'antd';
import AppHeader from '../component/layout/AppHeader';
const New = () => {
	return (
		<>
			<AppHeader></AppHeader>
			<main>
				<Row>
					<Col
						xs={{ span: 1, offset: 0 }}
						sm={{ span: 1, offset: 0 }}
						md={{ span: 0, offset: 0 }}
						xl={{ span: 0, offset: 0 }}
					></Col>
				</Row>
			</main>
		</>
	);
};

export default New;
